    data: |
      SELECT - col2 * - col2 * + - ( NULLIF ( - COUNT ( * ), col2 ) ) FROM tab1 AS cor0 GROUP BY col0, col2 HAVING NOT NULL BETWEEN - 78 AND SUM ( + - 55 ) + - AVG ( DISTINCT - 91 ) * - 65;
  - name: tab1

outputs:
  - name: q5485.out
    data: |
